class BinaryTreeNode {
		
	constructor(stockSymbol, stockName) {
		//stock name and the stock symbol
		this.stockSymbol = stockSymbol;
		this.stockName = stockName;
		
		//right and left nodes
		this.right = null;
		this.left = null;
	}
}

class BinarySearchTree {
	constructor() {
		this.root = null;
	}
	
	
	sortedArrayToBST(arr, start, end) {
		//base case
		if (start > end) {
			return null;
		}
		
		//get the middle element andm ake it root
		var midPoint = Math.floor((start + end) / 2);
				
		var node = new BinaryTreeNode(arr[midPoint][0], arr[midPoint][1]);
		
		//recursively construct left subtree and make it left child of the root
		node.left = this.sortedArrayToBST(arr, start, (midPoint - 1));
		
		//recursively construct right subtree and make it right child of the root
		node.right = this.sortedArrayToBST(arr, (midPoint + 1), end);
		
		return node;
	}
	
	preOrder(node) {
		if (node === null) {
			return;
		}
		
		console.log(node.stockSymbol + " ");
		this.preOrder(node.left);
		this.preOrder(node.right);
	}
	
	
	findMinNode(node) {
		if (node.left === null) {
			return node;
		}
		else {
			return this.findMinNode(node.left);
		}
	}
	
	getRootNode() {
		return this.root;
	}
	
	search(node, stockSymbol) {
		if (node === null) {
			return null;
		}
		else if (stockSymbol < node.stockSymbol) {
			return this.search(node.left, stockSymbol);
		}
		else if (stockSymbol > node.stockSymbol) {
			return this.search(node.right, stockSymbol);
		}
		
		else {
			return node;
		}
	}
	
	
	searchTopFive(node, stockSignature) {
		
		if (node === null) {
			return null;
		}
		else if (stockSymbol < node.stockSymbol) {
			return this.search(node.left, stockSymbol);
		}
		else if (stockSymbol > node.stockSymbol) {
			return this.search(node.right, stockSymbol);
		}
		
		else {
			return node;
		}
		
		
	}
}

